/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `placed_students` (
  `place_id` int(11) NOT NULL AUTO_INCREMENT,
  `student_id` int(11) DEFAULT NULL,
  `drive_id` int(11) DEFAULT NULL,
  `role_id` int(11) DEFAULT NULL,
  `comment` text DEFAULT NULL,
  `offer_letter_accepted` enum('yes','no','unknown') DEFAULT 'unknown',
  `offer_letter_received` enum('yes','no','unknown') DEFAULT 'unknown',
  `joining_status` enum('joined','not_joined','unknown') DEFAULT 'unknown',
  `joining_reason` text DEFAULT NULL,
  `upid` varchar(50) DEFAULT NULL,
  `program_type` varchar(50) DEFAULT NULL,
  `program` varchar(50) DEFAULT NULL,
  `course` varchar(100) DEFAULT NULL,
  `class` varchar(50) DEFAULT NULL,
  `reg_no` varchar(50) DEFAULT NULL,
  `student_name` varchar(100) DEFAULT NULL,
  `email` varchar(100) DEFAULT NULL,
  `phone_no` varchar(20) DEFAULT NULL,
  `company_name` varchar(100) DEFAULT NULL,
  `role` varchar(100) DEFAULT NULL,
  `ctc` varchar(50) DEFAULT NULL,
  `filled_on_off_form` varchar(20) DEFAULT 'not filled',
  `placement_batch` enum('original','reapplied') DEFAULT 'original',
  `placed_date` timestamp NULL DEFAULT current_timestamp(),
  `stipend` varchar(50) DEFAULT NULL,
  `drive_no` varchar(50) DEFAULT NULL,
  `offer_type` varchar(100) DEFAULT NULL,
  `percentage` float DEFAULT NULL,
  `edit_ctc` varchar(50) DEFAULT NULL,
  `edit_stipend` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`place_id`),
  UNIQUE KEY `unique_placed` (`student_id`,`drive_id`,`role_id`,`placement_batch`),
  KEY `student_id` (`student_id`),
  KEY `drive_id` (`drive_id`),
  KEY `role_id` (`role_id`),
  CONSTRAINT `placed_students_ibfk_1` FOREIGN KEY (`student_id`) REFERENCES `students` (`student_id`),
  CONSTRAINT `placed_students_ibfk_2` FOREIGN KEY (`drive_id`) REFERENCES `drives` (`drive_id`),
  CONSTRAINT `placed_students_ibfk_3` FOREIGN KEY (`role_id`) REFERENCES `drive_roles` (`role_id`)
) ENGINE=InnoDB AUTO_INCREMENT=585 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
